"use strict";(self.webpackChunkwoodpecker=self.webpackChunkwoodpecker||[]).push([["810"],{35077(e){e.exports=JSON.parse('{"name":"ASCII JUnit Test Report","slug":"ascii-junit-test-report","url":"https://github.com/wgroeneveld/woodpecker-ascii-junit","description":"A simple Woodpecker CI plugin that prints out JUnit summaries in ASCII.","docs":"<h1>Woodpecker-ascii-junit</h1>\\n<p>A simple Woodpecker CI plugin used by <a href=\\"https://github.com/jobrunr/jobrunr\\">JobRunr</a> that prints out JUnit summaries in ASCII:</p>\\n<pre><code>\\nJUnit Test Results: 3 Test Suites Found\\n----------------------------------------\\n\\n| Passed \u2705 | Failed \u274C | Errored \u{1F6AB} | Skipped \u23ED\uFE0F | Total \u{1F4C8} |\\n_______________________________________________________________\\n| 7         | 5          | 0          | 1          | 13       | \\n\\n\u23F1\uFE0F Total time: 1.378s\\n\\n\u274C Failed Test Details\\n----------------------\\n  \u{1F9EA} Test TestSubtests#package/subtests (\u23F1\uFE0F0s) Failure: Failed\\n  \u{1F9EA} Test TestSubtests/Subtest#01#package/subtests (\u23F1\uFE0F0s) Failure: Failed\\n    subtests_test.go:10: error message\\n  \u{1F9EA} Test TestFailingSubtestWithNestedSubtest#package/subtests (\u23F1\uFE0F0s) Failure: Failed\\n  \u{1F9EA} Test TestFailingSubtestWithNestedSubtest/Subtest#package/subtests (\u23F1\uFE0F0s) Failure: Failed\\n    subtests_test.go:31: Subtest error message\\n  \u{1F9EA} Test someTestName#org.SomeTest (\u23F1\uFE0F1.311s) Failure: java.lang.AssertionError: this should be that.\\njava.lang.AssertionError: this should be that\\n            at com.tngtech.archunit.lang.ArchRule$Factory$SimpleArchRule.verifyNoEmptyShouldIfEnabled(ArchRule.java:201)\\n            at com.tngtech.archunit.lang.ArchRule$Factory$SimpleArchRule.evaluate(ArchRule.java:181)\\n            at com.tngtech.archunit.lang.ArchRule$Assertions.check(ArchRule.java:84)\\n            at com.tngtech.archunit.lang.ArchRule$Factory$SimpleArchRule.check(ArchRule.java:165)\\n            at com.tngtech.archunit.lang.syntax.ObjectsShouldInternal.check(ObjectsShouldInternal.java:81)\\n            at com.tngtech.archunit.junit.internal.ArchUnitTestDescriptor$ArchUnitRuleDescriptor.execute(ArchUnitTestDescriptor.java:168)\\n            at com.tngtech.archunit.junit.internal.ArchUnitTestDescriptor$ArchUnitRuleDescriptor.execute(ArchUnitTestDescriptor.java:151)\\n            at java.base/java.util.ArrayList.forEach(ArrayList.java:1596)\\n            at java.base/java.util.ArrayList.forEach(ArrayList.java:1596)\\n</code></pre>\\n<p>This includes coloured console text output from <a href=\\"https://github.com/vinay03/chalk\\">chalk</a>.</p>\\n<p>If there are failing tests, details of those will be printed as well.</p>\\n<p>If you are using Drone-CI, consider using <a href=\\"https://github.com/rohit-gohri/drone-junit/\\">drone-junit</a> instead \\nthat has a nice Adaptive Card UI which is currently not supported by Woodpecker-CI.</p>\\n<p>This plugin reads JUnit XML files in a <code>path</code> glob pattern. If you\'re running JS Jest tests, add <a href=\\"https://github.com/jest-community/jest-junit\\">jest-junit</a> as a reporter and it\'ll be integrated as well.</p>\\n<h2>Configuration</h2>\\n<p>See <code>docker-compose.yml</code> as an example:</p>\\n<ul>\\n<li><code>PLUGIN_PATH</code> env var or <code>path</code> setting in Woodpecker</li>\\n<li>Optional: <code>PLUGIN_LOG_LEVEL</code> env var or <code>log-level</code> (built-in Woodpecker plugin)</li>\\n</ul>\\n<p>Here\'s an example how to include it in your Woodpecker workflow:</p>\\n<pre><code>  - name: junit-reports\\n    image: ghcr.io/wgroeneveld/woodpecker-ascii-junit:main\\n    settings:\\n      log-level: debug\\n      path: /tmp/reports/**/*.xml\\n    when:\\n      status: [\\n        \'success\',\\n        \'failure\',\\n      ]\\n</code></pre>\\n","tags":["testing","java","junit"],"author":"Wouter (@wgroeneveld)","containerImage":"ghcr.io/wgroeneveld/woodpecker-ascii-junit:main","containerImageUrl":"https://github.com/wgroeneveld/woodpecker-ascii-junit/pkgs/container/woodpecker-ascii-junit","verified":false}')}}]);